class TermoConserto extends DocBase {
    constructor() {
        super();
        // --- BASE64 DO FUNDO (CONSERTO) ---
        // 1. Pegue seu modelo de Conserto (3 vias), apague a logo e salve como imagem.
        // 2. Converta para Base64.
        // 3. Cole o c√≥digo gigante abaixo, DENTRO das aspas.
        this.fundoBase64 = "data:image/jpeg;base64,"; 
    }

    gerar(municipio) {
        if (!this.checkLib()) return;
        const { jsPDF } = window.jspdf;
        
        // Valida√ß√£o
        if (!this.fundoBase64) {
            alert("ATEN√á√ÉO: Voc√™ precisa colar o c√≥digo Base64 da imagem de fundo no arquivo 'termo-conserto.js'!");
            return;
        }

        const doc = new jsPDF(); // A4
        const logoCidade = this.getLogoForCity(municipio);

        // 1. DESENHA O FUNDO (Sua folha completa)
        try {
            doc.addImage(this.fundoBase64, 'PNG', 0, 0, 210, 297);
        } catch (e) {
            console.error(e);
            alert("Erro na imagem de fundo. Verifique o Base64.");
        }

        // 2. CARIMBA A LOGO DA CIDADE (SOMENTE NO TOPO)
        // Mantendo o padr√£o do Termo de Reserva: apenas a 1¬™ via recebe a logo.
        if (logoCidade) {
            const tamanho = 22;  // Tamanho da logo
            const xCentro = 105; // Centro da p√°gina
            const xPos = xCentro - (tamanho / 2); // Centraliza

            // --- Via 1 (Topo) ---
            // A altura Y=10 costuma ser padr√£o. Se ficar muito alto/baixo, ajuste esse n√∫mero.
            doc.addImage(logoCidade, 'PNG', xPos, 10, tamanho, tamanho);
            
            // --- Via 2 e 3 (Sem logo, conforme solicitado no anterior) ---
            // Caso queira voltar com elas, basta descomentar:
            // doc.addImage(logoCidade, 'PNG', xPos, 115, tamanho, tamanho);
            // doc.addImage(logoCidade, 'PNG', xPos, 210, tamanho, tamanho);
        }

        window.open(doc.output('bloburl'), '_blank');
    }
}